import React, { Component } from 'react';
import { Rnd } from 'react-rnd';

export default class Main extends Component {
  render() {
    return (
      <>
        <Rnd
          default={{
            x: 0,
            y: 0,
            width: 320,
            height: 200,
          }}
        >
          <div className="container">
            <div className="left">aaa</div>
            <div className="main">aaa</div>
          </div>
        </Rnd>
      </>
    );
  }
}
